package pl.web.share.host.model;


/**
 * Class stores data URI, for each background image.
 * Data URI is being stored in String type variables (hardcoded).
 * Singleton class.
 * Class is very messy - but hardcoding image data URI was the only solution to properly send
 * image data as a String type value via PrintWriter.
 */
public class BackgroundImageDataUri {

    private static BackgroundImageDataUri instance = null;
    private static String b1DataUri, b2DataUri, b3DataUri, b4DataUri, b5DataUri, b6DataUri;

    protected BackgroundImageDataUri() {
        initializeImages();
    }

    public static BackgroundImageDataUri getInstance() {
        if (instance == null)
            instance = new BackgroundImageDataUri();
        return instance;
    }

    /**
     * Method sets data URI code of every background image to proper String type values.
     * It's a real pain for your eyes..
     */
    private static void initializeImages() {
        b1DataUri = "data:image/jpeg;base64,";
        b2DataUri = "data:image/jpeg;base64,";
        b3DataUri = "data:image/jpeg;base64,";
        b4DataUri = "data:image/jpeg;base64,";
        b5DataUri = "data:image/jpeg;base64,";
        b6DataUri = "data:image/jpeg;base64,";
    }

    public String getB1DataUri() {
        return b1DataUri;
    }

    public String getB2DataUri() {
        return b2DataUri;
    }

    public String getB3DataUri() {
        return b3DataUri;
    }

    public String getB4DataUri() {
        return b4DataUri;
    }

    public String getB5DataUri() {
        return b5DataUri;
    }

    public String getB6DataUri() {
        return b6DataUri;
    }
}
